import React, { Component } from "react";
import MyTabNav from "../components/MyTabNav";
import NewNoteForm from "../components/NewNoteForm";
import data from "../data/data";

class App extends Component {
  constructor(props) {
    super(props);
    this.projectNames = Object.keys(data);
    this.projectMap = new Map(Object.entries(data));
    this.updateProjectNames = this.updateProjectNames.bind(this);
  }

  updateProjectNames = (newProject) => {
    this.projectNames.push(newProject);
  };

  render() {
    return (
      <div className="container">
        {this.projectMap.forEach(function (project) {
          project.map((note) => console.log(note));
        })}
        <MyTabNav
          projectNames={this.projectNames}
          projectMap={this.projectMap}
        />
        <NewNoteForm projectNames={this.projectNames} />
      </div>
    );
  }
}

export default App;
